namespace EncodeFile.Helpers;
public static class UIExtensions
{
    public static BitmapImage LoadImage(this byte[] byteArray)
    {
        using (MemoryStream stream = new MemoryStream(byteArray))
        {
            BitmapImage bitmap = new BitmapImage();
            bitmap.BeginInit();
            bitmap.StreamSource = stream;
            bitmap.CacheOption = BitmapCacheOption.OnLoad;
            bitmap.EndInit();
            return bitmap;
        }
    }
    public static void InitLoadingControl(this Window window, string bindingProp, int size = 64)
    {
        
        if (window == null) return;

        var root = window.Content as Panel;

        if (root == null)
        {
            var originalContent = window.Content as UIElement;
            var grid = new Grid();
            window.Content = grid;

            if (originalContent != null)
                grid.Children.Add(originalContent);

            root = grid;
        }
        Grid container = null;
        // Initialize overlay once
        if (container == null)
        {

            var image = new GifImage
            {
                //Source = FromBase64(B64_LOADING_IMAGE).LoadImage(), ///new BitmapImage(new Uri("pack://application:,,,/YourAssemblyName;component/Assets/loading.gif")),
                HorizontalAlignment = HorizontalAlignment.Center,
                VerticalAlignment = VerticalAlignment.Center,
                Width = size,
                Height = size,
                Stretch = Stretch.Uniform
            };
            image.SetGifImage(FromBase64(B64_LOADING_IMAGE));
            container = new Grid
            {
                Background = new SolidColorBrush(Color.FromArgb(128, 0, 0, 0)), // 50% transparent black
                HorizontalAlignment = HorizontalAlignment.Stretch,
                VerticalAlignment = VerticalAlignment.Stretch,
                Opacity = 0.6
            };

            container.Children.Add(image);
            Panel.SetZIndex(container, int.MaxValue);

            Binding binding = new Binding(bindingProp);  // Property to bind to in ViewModel
            binding.Source = window.DataContext; // The source (ViewModel)
            binding.Mode = BindingMode.TwoWay; // Two-way binding
            binding.UpdateSourceTrigger = UpdateSourceTrigger.PropertyChanged; // Optional
            binding.Converter = new BooleanToVisibilityConverter();
            container.SetBinding(Grid.VisibilityProperty, binding);
            
            //container.Visibility = Visibility.Hidden;
        }
        //window.Content = container;
        if (!root.Children.Contains(container))
        {
            if(root is Grid grid)
            {
                Grid.SetColumn(container, 0);
                Grid.SetColumnSpan(container, grid.ColumnDefinitions.Count);
                
                Grid.SetRow(container, 0);
                Grid.SetRowSpan(container, grid.RowDefinitions.Count);

            }
            root.Children.Add(container);
        }
    }
    static byte[] FromBase64(string base64)
    {
        MemoryStream outStream = new MemoryStream();
        StreamReader readStream = new StreamReader(new MemoryStream(UnicodeEncoding.ASCII.GetBytes(base64)));
        string line;
        while ((line = readStream.ReadLine()) != null)
        {
            outStream.Write(Convert.FromBase64String(line));
        }
        readStream.Close();
        byte[] result = outStream.ToArray();
        outStream.Close();
        return result;

    }

    const string B64_LOADING_IMAGE = @"






































































";
    class GifImage: Image
    {
        private int _currentFrame = 0;
        private DispatcherTimer _timer;
        public void SetGifImage(byte[] gifData)
        {
            using var stream = new MemoryStream(gifData);

            // Create the decoder
            var decoder = new GifBitmapDecoder(
                stream,
                BitmapCreateOptions.PreservePixelFormat,
                BitmapCacheOption.OnLoad // Load fully while stream is open
            );

            // Set the first frame
            this.Source = decoder.Frames[0];

            // Animate the frames using DispatcherTimer
            _timer = new DispatcherTimer
            {
                Interval = TimeSpan.FromMilliseconds(100) // Fixed delay
            };
            _timer.Tick += (s, e) =>
            {
                _currentFrame = (_currentFrame + 1) % decoder.Frames.Count;
                //if (_currentFrame == 0) _currentFrame = 1;
                this.Source = decoder.Frames[_currentFrame];
            };
            _timer.Start();
        }
    }
}


